import React from 'react';

const Games = () => {
  return (
    <div className="games-container">
      <div className="page-heading">
        <h1>Games Terminal</h1>
        <div className="terminal-status">SYSTEM STATUS: DEVELOPMENT MODE</div>
      </div>

      <div className="games-content">
        <div className="development-notice">
          <div className="notice-header">
            <span className="notice-icon">⚠️</span>
            <span className="notice-title">DEVELOPMENT IN PROGRESS</span>
          </div>
          <p className="notice-text">
            The Verse of the Sun gaming experiences are currently under development. 
            Our team is crafting immersive interactive adventures that will bring the 
            dark and thrilling universe to life through gameplay.
          </p>
        </div>

      </div>
    </div>
  );
};

export default Games;
